//000000086400a:2:{s:4:"show";a:16:{s:7:"list_id";s:2:"15";s:8:"list_pid";s:1:"2";s:8:"list_oid";s:2:"15";s:8:"list_sid";s:1:"1";s:9:"list_name";s:9:"国产剧";s:9:"list_skin";s:10:"pp_vodlist";s:8:"list_dir";s:9:"guochanju";s:11:"list_status";s:1:"1";s:13:"list_keywords";s:0:"";s:10:"list_title";s:0:"";s:16:"list_description";s:0:"";s:12:"list_jumpurl";s:0:"";s:8:"list_url";s:23:"/?s=vod-show-id-15.html";s:12:"list_url_big";s:22:"/?s=vod-show-id-2.html";s:13:"list_name_big";s:9:"电视剧";s:10:"list_limit";s:1:"8";}s:4:"read";a:47:{s:6:"vod_id";s:5:"22064";s:7:"vod_cid";s:2:"15";s:8:"vod_name";s:52:"成都，今夜请将我遗忘/都是爱情惹的祸";s:9:"vod_title";s:0:"";s:12:"vod_keywords";s:0:"";s:9:"vod_color";s:0:"";s:9:"vod_actor";s:33:"秦海璐 高虎 舒砚 李坤霖";s:12:"vod_director";s:9:"刘惠宁";s:11:"vod_content";s:1498:"<p>当男人遭遇欲望的急流时，还懂得遵守誓言的贞洁吗？女人被孤独围困时，偏离方向是不是命运必然的安排？</br></br>    2006年，成都。</br>　　</br>    陈重和赵悦结婚八年了，赵悦依然不倦地从生活的各个细节求证婚姻的安全程度，她需要的是细致的关心和绝对的忠贞。但陈重渴望的仍是火一样的爱情，就好像他大学毕业时为了赵悦从北京一路追到成都，放弃了父母和前途。</br></br>　　一次意外撞车，陈重结识了叶梅。</br></br>　　他为这个明艳、热情的女客户在保单上开了绿灯。叶梅的答谢宴上，陈重被灌醉，醒来以后发现自己躺在叶梅的床上……故作镇定的陈重根本不会想到，一环又一环的圈套已经等他很久……</br></br>　　陈重、李良、王林是从同一间大学宿舍走出来的兄弟……</br>　　睡上下铺</br>　　一起逃课</br>　　一起畅想未来</br>　　一起……追逐爱情</br></br>　　对感情一直保持着诗人式的天真的李良在网络上邂逅了一位美丽女子，并对她动了真情。一日，他隆重将她介绍给朋友们，哄闹声中陈重抬头，发现站在面前的竟然是叶梅！</br></br>　　陈重意识到自己将伤害这辈子对自己最重要的两个人，一个是同床共枕的老婆，一个是生死与共的兄弟。但他并没有意识到，故事，才开了一个头儿而已……</p>";s:7:"vod_pic";s:66:"http://img.cnjuc.com/pic/uploadimg/2009/11/2/20091102214139576.jpg";s:8:"vod_area";s:6:"大陆";s:12:"vod_language";s:0:"";s:8:"vod_year";s:1:"0";s:11:"vod_continu";s:1:"0";s:11:"vod_addtime";s:10:"1368671397";s:8:"vod_hits";s:2:"99";s:12:"vod_hits_day";s:1:"0";s:13:"vod_hits_week";s:1:"0";s:14:"vod_hits_month";s:1:"0";s:17:"vod_hits_lasttime";s:1:"0";s:9:"vod_stars";s:1:"1";s:10:"vod_status";s:1:"1";s:6:"vod_up";s:2:"87";s:8:"vod_down";s:2:"39";s:8:"vod_play";s:4:"qvod";s:10:"vod_server";s:0:"";s:7:"vod_url";s:2462:"第1集$qvod://108422793|2ED1D5B7D510B080B8A5B9F67ED6EE28D7C893D9|成都今夜请将我遗忘01.rmvb|第2集$qvod://106756491|5